import React from 'react';
import './NewMessagePopup.css';
import MinimizeIcon from '@material-ui/icons/Minimize';
import HeightIcon from '@material-ui/icons/Height';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import Input from '@material-ui/core/Input';
import TextField from '@material-ui/core/TextField';

function NewMessagePopup(props) {
    return (
        <div className="new-message-popup">
            <div className="new-message-header">
                <div className="new-message-popup-right">
                    <span>New Message</span>
                </div>
                <div classsName="new-message-popup-left">
                    <IconButton>
                        <MinimizeIcon/>
                    </IconButton>
                    <IconButton>
                        <div className="height-icon">
                        <HeightIcon/>
                        </div>
                    </IconButton>
                    <IconButton>
                        <CloseIcon/>
                    </IconButton>
                </div>
            </div>
            <div className="message-to">
                <Input placeholder="To" inputProps={{ 'aria-label': 'description' }} />
                <Input placeholder="Subject" inputProps={{ 'aria-label': 'description' }} />
            </div>
            <div className="message-description">
            <TextField
                id="outlined-multiline-static"
                multiline
                rows={4}
                defaultValue=""

            />
            </div>
        </div>
    );
}

export default NewMessagePopup;
